// src/components/Profile.js
import React, { useState } from 'react';
import './Profile.css';

const Profile = () => {
  const [selectedMenu, setSelectedMenu] = useState('My Programs'); // Default menu

  const handleMenuClick = (menuItem) => {
    setSelectedMenu(menuItem);
  };

  const renderContent = () => {
    switch (selectedMenu) {
      case 'My Programs':
        return (
          <div className="programs-content">
            <img src="/images/v1.jpg" alt="Program 1" />
            <img src="/images/v2.jpg" alt="Program 2" />
            <img src="/images/v3.jpg" alt="Program 3" />
          </div>
        );
      case 'Your Profile':
        return <div>Profile Content</div>;
      case 'My Diet Plans':
        return <div>Diet Plan Content</div>;
      case 'My Articles':
        return <div>Articles Content</div>;
      case 'My Medical History':
        return <div>Medical History Content</div>;
      case 'My Progress':
        return <div>Progress Content</div>;
      case 'My Trainer':
        return <div>Trainer Content</div>;
      case 'My Subscription':
        return <div>Subscription Content</div>;
      default:
        return <div>Default Content</div>;
    }
  };

  return (
    <div className="profile-page">
      {/* Sidebar */}
      <div className="sidebar">
        <div className="profile-header">
          <img src="/images/p.jpg" alt="Profile" className="profile-image" />
        </div>
        <ul>
          <li onClick={() => handleMenuClick('Your Profile')}>Your Profile</li>
          <li onClick={() => handleMenuClick('My Programs')}>My Programs</li>
          <li onClick={() => handleMenuClick('My Diet Plans')}>My Diet Plans</li>
          <li onClick={() => handleMenuClick('My Articles')}>My Articles</li>
          <li onClick={() => handleMenuClick('My Medical History')}>My Medical History</li>
          <li onClick={() => handleMenuClick('My Progress')}>My Progress</li>
          <li onClick={() => handleMenuClick('My Trainer')}>My Trainer</li>
          <li onClick={() => handleMenuClick('My Subscription')}>My Subscription</li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {renderContent()}
      </div>
    </div>
  );
};

export default Profile;
